import React from 'react';
import ReactDOM from 'react-dom';

function Slider(){
    return <div>
    <button class="slider__btn slider__previous"><img src="images/icon-prev.svg" alt="previous-slide" /></button>
    <button class="slider__btn slider__next"><img src="images/icon-next.svg" alt="next-slide" /></button>
    </div>
}

export default Slider
